set charset utf8;
DROP TABLE IF EXISTS `member_auth`;
CREATE TABLE `member_auth` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '',
  `member_id` int(10) unsigned NOT NULL COMMENT 'ID',
  `name` varchar(60) NOT NULL COMMENT '',
  `idcard_no` varchar(60) NOT NULL COMMENT '',
  `img_1` varchar(60) NOT NULL COMMENT '',
  `img_2` varchar(60) NOT NULL COMMENT '',
  `dateline` int(10) unsigned NOT NULL COMMENT '',
  `status` tinyint(1) NOT NULL COMMENT '(0:;1:;2:)',
  PRIMARY KEY (`id`),
  KEY `member_id` (`member_id`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `member_group`;
CREATE TABLE `member_group` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `group_name` varchar(30) NOT NULL COMMENT '',
  `condition_point` text NOT NULL COMMENT '',
  `condition_consumption` varchar(255) NOT NULL COMMENT '',
  `ratio` decimal(2,2) unsigned NOT NULL COMMENT '',
  `setting` text NOT NULL COMMENT '',
  `status` tinyint(1) unsigned NOT NULL COMMENT '(-1:;1:)',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `member_profile`;
CREATE TABLE `member_profile` (
  `member_id` int(10) unsigned NOT NULL,
  `avatar` text NOT NULL,
  `member_name` varchar(60) NOT NULL,
  `seller_name` varchar(60) NOT NULL,
  `alias` varchar(30) NOT NULL,
  `sex` tinyint(1) unsigned NOT NULL,
  `mobile` varchar(60) NOT NULL,
  `telephone` varchar(60) NOT NULL,
  `company` varchar(60) NOT NULL,
  `province_id` mediumint(8) unsigned NOT NULL,
  `city_id` mediumint(8) unsigned NOT NULL,
  `county_id` mediumint(8) unsigned NOT NULL,
  `address` varchar(255) NOT NULL,
  `memo` varchar(255) NOT NULL,
  PRIMARY KEY (`member_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
